import React from 'react';
import { Button, Avatar } from '@geist-ui/react';
import { ProfileContainer, ProfileHeader } from '../Profile';
import { TextMedium16, TextMedium22 } from '../../utils';

function Profile() {
  return (
    <ProfileContainer>
      <ProfileHeader>
        <div className='profile-header'>
          <div className='profile-header__left'>
            <div className='profile-header__meta'>
              <Avatar
                src='https://images.unsplash.com/photo-1570295999919-56ceb5ecca61?ixid=MXwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80'
                size='large'
              />
            </div>
          </div>

          <div className='profile-header__right'>
            <Button auto> Edit Profile</Button>
          </div>
        </div>
      </ProfileHeader>
    </ProfileContainer>
  );
}

export default Profile;
